    and Wayne Township GOP Club are both state committees and thus have no Federal
    Designated Numbers.  Several contributors were initally hesitant to include occupations
    and employers.  After recieving your letter I researched them for phone numbers
    and made up to three calls per contributor.  All eventually either returned messages
    that I left or were caught at home and all contributed the enformation requested.
    \ Due to the time constraints of clearing these matters up, no letters were written.
    \ No violations of amount constraints were detected.\n"
